import './App.css';
import Intro from './Intro';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Intro></Intro>

      <Routes>
        <Route path="/catalog" element={<h2>Catalog Page</h2>} />
      </Routes>
    </Router>

  );
}

export default App;
